import React from "react";
import Image from "next/image";
import { HeaderWrap, HeaderContainer, LogoText, HeaderItems, HeaderItem, Logo,  } from "../styles/Header";

function Header() {
  return (

    <HeaderWrap>
      <div className="container">
        <HeaderContainer>
            <Logo>
                <Image src="/piano.svg" width={30} height={30}/>
                <LogoText>Мелодром</LogoText>
            </Logo>
            <HeaderItems>
                <HeaderItem>
                    Слободни термини
                </HeaderItem>
                <HeaderItem>
                    Локација
                </HeaderItem>
                <HeaderItem>
                    Контакт
                </HeaderItem>
            </HeaderItems>
        </HeaderContainer>
      </div>
    </HeaderWrap>

  );
}

export default Header;
